Money talks -&gt; Rylie Richman - All about the cash

Tue January 18, 2011
This week on money talks we find a group of girls willing to take a popsicle eating contest to the next level! Popsicles and pussy, imagine how that went down! Then we light a guys crotch on fire and have a girl sandpaper her cooch! Then Michelle and the crew do a little shopping where they get a whole bunch of customers willing to do anything for some green. Eventually they convince Rylie to close shop and show us all she has for the right price!
